import Button from "@mui/material/Button";
import ThreeDRotation from '@mui/icons-material/ThreeDRotation'

function App() {
  return (
  <>
  <Button variant="contained" disableElevation color="success">Hello world</Button>
  <Button variant="text" color="secondary">Hello world</Button>
  <Button variant="outlined" color>Hello world</Button>
  <ThreeDRotation />
  </>
  );
}

export default App;
